import React from "react";
import { 
  createStackNavigator, 
  createAppContainer, 
  createBottomTabNavigator
} from 'react-navigation';

{/** Visitor's screen */}
import HomeScreen from './src/screens/HomeScreen';
import AdmissionScreen from './src/screens/AdmissionScreen';
import ProgramScreen from './src/screens/ProgramsScreen';
import LoginScreen from './src/screens/LoginScreen';
import NewScreen from './src/screens/NewsScreen';
import MapScreen from  './src/screens/MapScreen';
import AboutScreen from './src/screens/AboutScreen';
import CheckStatus from './src/screens/subscreens/CheckStatus';
import SoonScreen from './src/screens/SoonScreen';
{/** Logined screen */}
import ProfileScreen from './src/screens/logined/ProfileScreen';

const VisitorsScreens = createStackNavigator({
  Home: HomeScreen,
  Admission: AdmissionScreen,
  Programs: ProgramScreen,
  Map: MapScreen,
  News: NewScreen,
  About: AboutScreen,
  Login: LoginScreen,
  CheckStatus: CheckStatus,
  Soon: SoonScreen
},
{
  headerMode: 'none',
  initialRouteName: "Login"
});

const LoginnedScreens = createBottomTabNavigator({
  Profile: ProfileScreen
})

export default createAppContainer(createStackNavigator(
  {
    Visitors: VisitorsScreens,
    Loginned: LoginnedScreens
  },
  {
    headerMode: 'none'
  }
));
